import React, { Component } from 'react';

class Blogs extends Component {
  state = {
    marked: '',
  }

  render() {
    const { marked } = this.state;
    return (
      <div className="blogs">
        <h1>Blogs</h1>
        <div>
          <h2>Write Here</h2>
          <input type="textarea" value={marked} />
        </div>
        <div>
          <h2>Preview here</h2>
        </div>
      </div>
    );
  }
}

export default Blogs;
